89f6c8801b312788f1d6d32ff3092a5a922bf96f:
query AskCollection($collectionName: String!, $query: String!) {
  askCollection(collectionName: $collectionName, query: $query)
}

bc23042ef93cfec1dbce064866f9914f5726641c:
query GetInvestingEntity($id: ID!) {
  getInvestingEntity(id: $id) {
    address
    companies {
      attributes {
        field {
          description
          id
          name
        }
        value {
          stringValue
          booleanValue
          dateValue
          emailValue
          floatValue
          intValue
          ipAddressValue
          phoneValue
          jsonValue
          timeValue
          timestampValue
          urlValue
          dateTimeValue
        }
      }
      id
    }
    entityType
    name
    strategy
    investmentCriteria {
      required
    }
    id
  }
}

605e8161a4d675a31b97dc3831e5caf14ee4e519:
query GetUser($id: ID!) {
  getUser(id: $id) {
    email
    id
    investingEntities {
      name
      address
      entityType
      strategy
      id
      companies {
        id
        attributes {
          field {
            id
            name
            description
          }
          value {
            stringValue
          }
        }
      }
    }
  }
}

